import React from 'react';

class Clock extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      time: new Date().toTimeString(),
    };
  }

  getTime = (_) => {
    this.setState({
      time: new Date().toTimeString(),
    });
  };

  render() {
    return <h1>{this.state.time}</h1>;
  }
}

export default Clock;
